[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?protein ?proteinLabel ?function
WHERE {
  ?protein a up:Protein ;
           rdfs:comment ?function .

  FILTER(CONTAINS(LCASE(?function), "membrane receptor") || 
         CONTAINS(LCASE(?function), "receptor protein"))

  OPTIONAL { ?protein up:recommendedName/up:fullName ?proteinLabel }
}
LIMIT 50
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?protein ?name ?comment
WHERE {
  ?protein a up:Protein ;
           up:annotation ?annotation .

  ?annotation a up:Function_Annotation ;
              rdfs:comment ?comment .

  FILTER(CONTAINS(LCASE(?comment), "membrane receptor"))

  OPTIONAL { ?protein up:recommendedName/up:fullName ?name }
}
LIMIT 30
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?protein ?name ?comment
WHERE {
  ?protein a up:Protein ;
           up:annotation ?annotation .

  ?annotation a up:Function_Annotation ;
              rdfs:comment ?comment .

  FILTER(REGEX(?comment, "receptor.*membrane", "i") || 
         REGEX(?comment, "membrane.*receptor", "i"))

  OPTIONAL { ?protein up:recommendedName/up:fullName ?name }
}
LIMIT 50
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?protein ?name ?comment
WHERE {
  ?protein a up:Protein ;
           up:annotation ?annotation .

  ?annotation a up:Function_Annotation ;
              rdfs:comment ?comment .

  FILTER(REGEX(?comment, "^(Receptor|Functions as a receptor|Acts as a receptor)", "i"))

  OPTIONAL { ?protein up:recommendedName/up:fullName ?name }

  FILTER(CONTAINS(LCASE(?comment), "membrane"))
}
LIMIT 50
"}}]
